import React from 'react'
import CategoriesLink from './CategoriesLink.js'
import './Sidebar.css'

export default class CategoriesDiv extends React.Component {
    render() {
        const categoriesNamesArray = this.props.categories.map(category => category.name);
        const categoriesIdsArray = this.props.categories.map(category => category.id);
        console.log(categoriesNamesArray)
        let filteredCategories = categoriesNamesArray.toString().split(',');
        console.log(filteredCategories)


        return (
            <div id="categoriesDiv">
                {filteredCategories.map(function (category) {
                    return <CategoriesLink category={category} />
                })}
            </div>
        );
    }
}
